import ImageList from '@material-ui/core/ImageList';

function ResultsDisplay (pics){
    const imageListContent=(<ImageList cols={3}>
        {pics.map(img => (
            <img src={img.largeImageURL} alt="" />

            ))}
        </ImageList>) 


    return (
        <div>
            {imageListContent}
        </div>
    )






}

export default ResultsDisplay
